<template>
  <nav class="navbar">
    <router-link to="/">
      <svg class="logo" viewBox="0 0 520 601" fill="none" xmlns="http://www.w3.org/2000/svg"
           xmlns:xlink="http://www.w3.org/1999/xlink">
        <rect width="520" height="601" fill="url(#pattern0_10_10)"/>
        <defs>
          <pattern id="pattern0_10_10" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlink:href="#image0_10_10" transform="scale(0.00192308 0.00166389)"/>
          </pattern>
          <image id="image0_10_10" width="520" height="601"
                 xlink:href="data:image/png;base64,"/>
        </defs>
      </svg>
    </router-link>
    <div class="nav-links">
      <router-link to="/">
        <svg class="log-nav" viewBox="0 0 520 601" fill="none" xmlns="http://www.w3.org/2000/svg"
             xmlns:xlink="http://www.w3.org/1999/xlink">
          <rect width="520" height="601" fill="url(#pattern0_10_10)"/>
          <defs>
            <pattern id="pattern0_10_10" patternContentUnits="objectBoundingBox" width="1" height="1">
              <use xlink:href="#image0_10_10" transform="scale(0.00192308 0.00166389)"/>
            </pattern>
            <image id="image0_10_10" width="520" height="601"
                   xlink:href="data:image/png;base64,"/>
          </defs>
        </svg>

      </router-link>
      <hr>
      <ul>
        <li>
          <router-link class="link" to="/" @click="closeMenu">Accueil</router-link>
        </li>
        <li>
          <router-link class="link" to="/about" @click="closeMenu">Inoubliable</router-link>
        </li>
        <li class="bouutu">
          <ButtonComponent link="/game" text="Jouer"/>
        </li>
      </ul>
      <hr>
    </div>
    <div class="burgeur" @click="toggleMenu">
      <span class="line line1" :class="{ 'active': isOpen }"></span>
      <span class="line line2" :class="{ 'active': isOpen }"></span>
    </div>
  </nav>
</template>

<script>
import ButtonComponent from "@/components/ButtonComponent.vue";

export default {
  name: 'BugeurMenu',
  components: {ButtonComponent},
  mounted() {
    const menuberguer = document.querySelector('.burgeur');
    const navLinks = document.querySelector('.nav-links');

    menuberguer.addEventListener('click', () => {
      navLinks.classList.toggle('open');
    });

    // Close the menu when a link is clicked with vue-router
    this.$router.afterEach(() => {
      this.closeMenu();
    });
  },
  data() {
    return {
      isOpen: false,
    };
  },
  methods: {
    toggleMenu() {
      this.isOpen = !this.isOpen;
    },
    closeMenu() {
      // Réinitialise les lignes du burger et ferme le menu
      this.isOpen = false;
      const navLinks = document.querySelector('.nav-links');
      navLinks.classList.remove('open'); // Fermer le menu

      const spans = document.querySelectorAll('.line');
      spans.forEach(span => {
        span.classList.remove('active'); // Réinitialiser les lignes
      });
    }
  },
};
</script>


